import React from 'react'
import { StyleSheet, Text, View } from 'react-native';

const Header = () => {
    return (
        <View style={stylesHeader.containers}>
            <div>
                This is Header!
            </div>
        </View>
    )
}

export default Header


const stylesHeader = StyleSheet.create({
    containers: {
        backgroundColor: '#000',
    },
});
